import React from 'react'

function FileList(props) {
  const post = props.post;
  console.log('post',post);
  return (
    <div>
      <ul> 
        <li>symbol : {post.symbol}</li>
        <li>priceChange :{post.priceChange}</li>
        <li>priceChangePercent :{post.priceChangePercent}</li>
      </ul>
    </div>
  )
}

export default FileList
